		// audio components 
		var main = this.main;
		var ui = main.ui;
		var hand = ui.hand;
		var upgradeBtn = ui.button;
		var upgradeCount = 0;

		window.addEventListener('activateUpBtn', function () {
			musicBG.play();
			upgradeBtn.clickable = true;

			}
		});
		window.addEventListener('hideUpBtn', function () {
			ui.gotoAndPlay(45);
		});
		upgradeBtn.addEventListener('click', upgradeFacility);
		function upgradeFacility() {
			//upgrade current facility
			if (upgradeBtn.clickable) {
				btnSFX.play();
				if (upgradeCount == 0) {
					sgt.gotoAndPlay(1);
					upgradeBtn.play();
					upgradeBtn.clickable = false;
				}
				if (upgradeCount == 1) {
					training.gotoAndPlay(1);
					upgradeBtn.play();
					upgradeBtn.clickable = false;
				}
				if (upgradeCount >= 2) {
					callToAction();
				}
				upgradeCount++;
			}
		}
		window.addEventListener('goToNextFacility', function () {
			if (upgradeCount == 1) {
				main.scene.gotoAndPlay(35);
			}
			if (upgradeCount == 2) {
				main.scene.gotoAndPlay(50);
			}
		});
		function callToAction() {

		function resizeCanvas(canvas, context, width, height) {
			var tmpCanvas = document.createElement('canvas');;
			tmpCanvas.width = context.canvas.width;
			tmpCanvas.height = context.canvas.height;
			var tempContext = tmpCanvas.getContext("2d");
			tempContext.drawImage(context.canvas, 0, 0);
			canvas.width = width;
			canvas.height = height;
			context.drawImage(tempContext.canvas, 0, 0);
		}
		window.addEventListener('resize', onResize);
		function onResize(event) {
			if (document.documentElement.clientWidth < document.documentElement.clientHeight) {
